import { useState } from "react";
import axios from 'axios'
import { postUser } from "../../../api";

function Reg() {
    const [data, setData] = useState([])

    const [avatar, setAvatar] = useState()
    const [username, setUsername] = useState()
    const [email, setEmail] = useState()
    const [passwords, setPasswords] = useState()
    const [bio, setBio] = useState()
    const [dates] = useState(new Date()) 

    const submit = () => {
        setData(avatar, username, email, passwords, bio, dates)
        console.log('datas = ', data)
        axios
            .post("http://localhost:8080/api/user/reg", {
                avatar: avatar, 
                username: username, 
                email: email, 
                passwords: passwords, 
                bio: bio, 
                dates: dates
            })
            
            // postUser()
            
            .then((response) => {
                console.log(response)
                setData(response)
            })
            
            .catch((error) => {
                console.log('Ошибка : ',error)
            })
    }; 



    return (  
        <div className="">
            <input type="url" placeholder="avatar" onChange={e => setAvatar(e.target.value)} /> <br />

            <input type="text" placeholder="username" onChange={e => setUsername(e.target.value)} /> <br />
            
            <input type="email" placeholder="email" onChange={e => setEmail(e.target.value)} /> <br />

            <input type="password" placeholder="password" onChange={e => setPasswords(e.target.value)} /> <br />

            <input type="number" placeholder="bio" onChange={e => setBio(e.target.value)} /> <br />
            
            <div className="" >
                {data.data}
            </div>

            <input type="button" value={"отправить"} onClick={submit}/>
        </div>
    );
}

export default Reg;
